import React from 'react';

const MenuCard = ({menuData}) => {
  return (
    <>
        {menuData.map((currentValue, index, arr) =>{
            return(
                <>
                    <div className="card-container" key={currentValue.id}>
                        <div className="card">
                            <div className="card-body">
                                <span className="card-number card-circle subtle">{currentValue.id}</span>
                                <span className="card-author subtle">{currentValue.category}</span>
                                <h2 className="card-title">{currentValue.name}</h2>
                                <span className="card-description subtle">
                                    {currentValue.description}
                                </span>
                                <div className="card-read">Read</div>
                            </div>    
                            {/*<img className="card-media" src="{image}" alt="images" />*/}
                            <span className="card-tag subtle">Order Now</span>
                        </div>
                    </div>
                </>
            )
        })}
        
    </>
  )
}

export default MenuCard;
